import Menu from "../Menu/Menu";
import Head from "next/head";

const pageStyles = {
  padding: 0
};

const Style = props => (
  <div>
    <Head>
      <title>It just works</title>
      <meta name="viewport" content="initial-scale=1.0, width=device-width" />
    </Head>
    <div style={pageStyles}>
      <Menu />
      {props.children}
    </div>
  </div>
);

export default Style;
